import React from 'react';
import { Card, Avatar } from 'antd';

const UserProfile = () => {
  return (
    <Card>
      <Card.Meta avatar={<Avatar>Di</Avatar>} title="Di" />
    </Card>
  );
};

export default UserProfile;
